pragma solidity ^0.6.0;

import "@openzeppelin/contracts/token/ERC1155/ERC1155.sol";
import "@openzeppelin/contracts/token/ERC1155/ERC1155Receiver.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./interfaces/IFAMAsset.sol";


contract FAMAsset is ERC1155, IFAMAsset, Ownable {
    mapping (address => bool) public _minters;
    mapping (uint256 => Asset) public assets;
    uint256 public assetsLenght = 0;

    struct Asset {
        uint256 id;
        string name;
        uint32 power;
    }

    constructor() public ERC1155(""){
        _minters[msg.sender] = true;

        addNewType("trattore", 1000);
        addNewType("zappatrice", 100);
    }

    function mint(address to, uint256 id, uint256 amount, bytes calldata data) external {
        require(_minters[msg.sender], "!minter");

        _mint( to,  id,  amount, data);
    }

    function mintBatch(address to, uint256[] calldata ids, uint256[] calldata amounts, bytes calldata data) external {
        require(_minters[msg.sender], "!minter");

        _mintBatch( to,  ids,  amounts, data);
    }

    function addNewType(string memory name, uint32 power) public  {
        require(_minters[msg.sender], "!minter");

        assets[assetsLenght] = Asset({
            id: assetsLenght,
            name: name,
            power: power
        });
        assetsLenght++;
    }

    function getAssetsLenght() external view returns(uint256){
        return assetsLenght;
    }

    function getAssetType(uint256 _id) override external view returns(uint256, string memory, uint32){
        Asset storage asset = assets[_id];
        return(asset.id, asset.name, asset.power);
    }

    function addMinter(address _minter) external onlyOwner {
        _minters[_minter] = true;
    }

    function removeMinter(address _minter) external onlyOwner {
        _minters[_minter] = false;
    }
}
